import { useState } from 'react';
import {
    HashRouter as Router,
    Route,
    Routes,
    Navigate,
} from 'react-router-dom';

import Home from './Components/Home/Home';
import SignUp from './Components/SignUp/SignUp';
import ViewAllCourses from './Components/Courses/ViewAllCourses';
import Login from './Components/SignUp/Login';
import MyForm from './Components/OutlinedInput/MyForm';
import CoursesPageUIUX from './Components/CoursesPageALL/UIUX/CoursesPageUIUX';
import CoursesPageDjango from './Components/CoursesPageALL/Django/CoursesPageDjango';
import CoursesPageFE from './Components/CoursesPageALL/Frontend/CoursesPageFE';
import DashBoard from './Components/DashBoard/DashBoard';
import MyCourses from './Components/DashBoard/MyCourses';
import MyCertificate from './Components/DashBoard/MyCertificate';
import MyNotification from './Components/DashBoard/MyNotification';
import LandingPage from './Components/LAndingPage/LandingPage';
import PasswordReset from './Components/SignUp/PasswordReset';
import CreatePassword from './Components/SignUp/CreatePassword';

function App() {
    const [authenticated, setAuthenticated] = useState(false);

    // Simulated authentication logic
    const authenticate = () => {
        setAuthenticated(false);
    };

    // const logout = () => {
    //     setAuthenticated(false);
    // };

    return (
        <Router>
            <Routes>
                {/* Landing Page */}
                <Route
                    exact
                    path="/"
                    element={
                        authenticated ? <Navigate to="/dashboard" /> : <LandingPage />
                    }
                />

                {/* Auth Routes */}
                <Route
                    exact
                    path="/signup"
                    element={<SignUp authenticate={authenticate} />}
                />
                <Route
                    exact
                    path="/login"
                    element={<Login authenticate={authenticate} />}
                />
                <Route exact path="/passwordreset" element={<PasswordReset />} />
                <Route
                    exact
                    path="/createpassword/:uidb64/:token"
                    element={<CreatePassword />}
                />

                {/* Protected Routes */}
                {authenticated && (
                    <>
                        <Route exact path="/dashboard" element={<DashBoard />} />
                        <Route exact path="/mycourses" element={<MyCourses />} />
                        <Route exact path="/mycerti" element={<MyCertificate />} />
                        <Route exact path="/mynoti" element={<MyNotification />} />
                    </>
                )}

                {/* Public Routes */}
                <Route exact path="/home" element={<Home />} />
                <Route exact path="/form" element={<MyForm />} />
                <Route exact path="/coursespageuiux" element={<CoursesPageUIUX />} />
                <Route
                    exact
                    path="/coursespagedjango"
                    element={<CoursesPageDjango />}
                />
                <Route exact path="/coursespagefe" element={<CoursesPageFE />} />
                <Route exact path="/viewallcourses" element={<ViewAllCourses />} />

                {/* 404 Page */}
                <Route path="*" element={<h1>404 - Not Found</h1>} />
            </Routes>
        </Router>
    );
}

export default App;
